import styled from "styled-components";

export interface props {
    width?: any;
    margin?: any
}

export const Flex = styled.div`
    display: flex;
    flex : 'wrap';
`

export const NonFlex = styled.div<props>`
    width : ${p => p.width ? p.width : ""};
    margin : ${p => p.margin ? p.margin : ""};
`
